'''Flynn's Mace Market''' is a [[mace]] shop owned by [[Flynn]] in [[Falador]]. It is located between the [[Falador General Store]] and the [[Hairdresser]] in the north-western part of the city.

==Stock==
{{StoreTableHead|sellmultiplier=1000|buymultiplier=600|delta=10}}
{{StoreLine|name=Bronze mace|stock=5|restock=100}}
{{StoreLine|name=Iron mace|stock=4|restock=200}}
{{StoreLine|name=Steel mace|stock=4|restock=400}}
{{StoreLine|name=Mithril mace|stock=3|restock=3000}}
{{StoreLine|name=Adamant mace|stock=2|restock=12000}}
{{StoreTableBottom}}

==Trivia==
*Inside the shop, a barrel and [[Rack (Flynn's Mace Market.)|rack]] can be seen holding maces that appear to have larger spikes and unusually long handles. These maces are unobtainable.
*A [[Tzhaar-ket-em]] can be seen next to the steel mace on the counter. However, it is only scenery and cannot be picked up or bought from the shop.

